import React from "react";
import usersData from "./usersData";

const User = ({ user }) => {
    const { name, age, phone, email, display } = user;

    return (
        <div>
            <button onClick={() => (user.display = !user.display)}>
                {display ? "Hide" : "Show"}
            </button>
            {display && (
                <div>
                    <p>Name: {name}</p>
                    <p>Age: {age}</p>
                    <p>Phone: {phone}</p>
                    <p>Email: {email}</p>
                </div>
            )}
        </div>
    );
};

const Users = ({ usersData }) => {
    return (
        <div>
            {usersData.map((user) => (
                <User key={user.id} user={user} />
            ))}
        </div>
    );
};

export default function App() {
    return <Users usersData={usersData} />;
}
